import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import Swal from 'sweetalert2';
import { Sun, Moon, Settings, Menu } from 'lucide-react';

const Navbar = () => {
  const [isDark, setIsDark] = useState(false);
  const [showSettings, setShowSettings] = useState(false);
  const [showMobileMenu, setShowMobileMenu] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    document.documentElement.classList.toggle('dark', isDark);
  }, [isDark]);

  const handleLogout = () => {
    Swal.fire({
      title: 'Are you sure you want to logout?',
      icon: 'warning',
      showCancelButton: true,
      confirmButtonText: 'Yes, Logout',
      cancelButtonText: 'No',
      customClass: {
        confirmButton: '!bg-red-600 !text-white !px-4 !py-2 !rounded',
        cancelButton: '!bg-gray-300 !text-black !px-4 !py-2 !rounded'
      },
      buttonsStyling: false
    }).then((result) => {
      if (result.isConfirmed) {
        navigate('/');
      }
    });
  };

  return (
    <>
      {/* Blur overlay */}
      {showMobileMenu && <div className="fixed inset-0 bg-black bg-opacity-40 z-30 backdrop-blur-sm" onClick={() => setShowMobileMenu(false)}></div>}

      {/* Navbar */}
      <nav className="bg-white dark:bg-gray-900 shadow-md px-6 py-3 flex items-center justify-between fixed top-0 left-0 w-full z-40">
        {/* Logo */}
        <div className="text-2xl font-bold text-indigo-600 dark:text-indigo-300">
          SmartDocAI
        </div>

        {/* Desktop Menu */}
        <div className="hidden md:flex items-center space-x-6 text-gray-800 dark:text-white font-medium">
          <Link to="/" className="hover:text-indigo-500 transition">Home</Link>
          <Link to="/upload" className="hover:text-indigo-500 transition">Analyze</Link>

          <button
            onClick={() => navigate('/signup')}
            className="px-3 py-1.5 rounded-full bg-indigo-600 text-white hover:bg-indigo-500 text-sm"
          >
            Sign Up
          </button>

          <button
            onClick={() => navigate('/login')}
            className="px-3 py-1.5 rounded-full bg-white text-indigo-600 border border-indigo-600 hover:bg-indigo-100 text-sm"
          >
            Login
          </button>

          <div
            className="relative"
            onMouseEnter={() => setShowSettings(true)}
            onMouseLeave={() => setShowSettings(false)}
          >
            <div className="ml-3 p-2 bg-gray-200 dark:bg-gray-700 rounded-full cursor-pointer hover:bg-gray-300 dark:hover:bg-gray-600">
              <Settings size={18} />
            </div>
            {showSettings && (
              <div className="absolute right-0 mt-2 w-40 bg-white dark:bg-gray-800 border border-gray-300 dark:border-gray-700 rounded-lg shadow-lg z-50 text-sm">
                <button
                  onClick={() => setIsDark(!isDark)}
                  className="w-full px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-700 flex items-center gap-2"
                >
                  {isDark ? <Sun size={16} /> : <Moon size={16} />} Toggle Theme
                </button>
                <button
                  onClick={handleLogout}
                  className="w-full px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-700 text-red-500"
                >
                  Logout
                </button>
              </div>
            )}
          </div>
        </div>

        {/* Hamburger for mobile */}
        <div className="md:hidden flex items-center">
          <button onClick={() => setShowMobileMenu(!showMobileMenu)} className="p-2 rounded bg-gray-200 dark:bg-gray-700">
            <Menu />
          </button>
        </div>
      </nav>

      {/* Mobile Sidebar */}
      {showMobileMenu && (
        <div className="fixed top-0 left-0 h-full w-64 bg-white dark:bg-gray-900 z-50 shadow-lg p-6">
          <div className="text-2xl font-bold mb-6 text-indigo-600 dark:text-indigo-300">
            SmartDocAI
          </div>
          <div className="flex flex-col space-y-4 text-gray-800 dark:text-white font-medium">
            <Link to="/" onClick={() => setShowMobileMenu(false)}>Home</Link>
            <Link to="/upload" onClick={() => setShowMobileMenu(false)}>Analyze</Link>
            <button
              onClick={() => {
                navigate('/signup');
                setShowMobileMenu(false);
              }}
              className="px-3 py-2 rounded bg-indigo-600 text-white"
            >
              Sign Up
            </button>
            <button
              onClick={() => {
                navigate('/login');
                setShowMobileMenu(false);
              }}
              className="px-3 py-2 rounded border border-indigo-600 text-indigo-600 bg-white dark:bg-transparent"
            >
              Login
            </button>

            <button
              onClick={() => {
                setIsDark(!isDark);
                setShowMobileMenu(false);
              }}
              className="px-3 py-2 rounded bg-gray-100 dark:bg-gray-700 flex items-center gap-2"
            >
              {isDark ? <Sun size={16} /> : <Moon size={16} />} Toggle Theme
            </button>

            <button
              onClick={() => {
                setShowMobileMenu(false);
                handleLogout();
              }}
              className="px-3 py-2 rounded text-red-500 border border-red-400"
            >
              Logout
            </button>
          </div>
        </div>
      )}
    </>
  );
};

export default Navbar;
